    false,nt"url": null,nt"notes": "This document is the completed effort of
    the U.S. Fish and Wildlife Service, Wilderness Fellows program to develop a monitoring
    strategy and evaluate the status of the Florida Keys Wilderness. This document gives
    context to the status of the Florida Keys wilderness and identifies the major management
    challenges associated with maintaining wilderness character. This document is intended
    to be a reference source for readers interested in understanding the wilderness
    and to detail the natural and anthropogenic impacts that threaten the state of wilderness
    character. The Florida Keys Wilderness Character Monitoring Plan was developed using
    distinct measures that assess the following: untrammeled quality, natural quality,
    undeveloped quality, and solitude or primitive and unconfined recreation quality.",nt"license_title":
